            tmpInterstitialShowDelay = interstitialShowDelay;

            // Initialization of the events of the slider
            $("p.nav_id").text((plugin.mainSlider.currSlideId + 1) + " " + slidePagingIndicator + " " + (plugin.mainSlider.numSlides));
