//                plugin.plugin.mainSlider.goTo(0);
//            });
            $('.view-fullscreen', displayDiv).click(function (e) {
                e.preventDefault();
                if (isFullscreen) {
                    exitFullscreen();
                } else {
                    enterFullscreen();
                }
            });

            $('div.slideshow_root', displayDiv).click(function (e) {
                if (($('div.leaderboard-container', displayDiv).has(e.target).length === 0) &&
                    ($('div.main_content', displayDiv).has(e.target).length === 0) &&
                    ($('div.similar_slideshows', displayDiv).has(e.target).length === 0)) {
                    if (!isCloseInterstitial) {
                        if ($('.fullpage_interstitial', displayDiv).is(":empty")) {
                            // close slider
                            $("a.close", displayDiv).trigger('click');
                        }

                    } else {
                        // close interstitial
                        plugin.utils.GAtrackEvent(plugin.ssInfo.title, 'Close_Interstitial');
                        $(".fullpage_interstitial", displayDiv).empty();
                        $(".interstitial_container", displayDiv).hide();
                        isCloseInterstitial = false;
                    }
                }
            });

            $('a.addthis_button_pinterest_share', displayDiv).click(function (e) {
                e.preventDefault();
                if (isFullscreen) {
                    exitFullscreen();
                }
            });

            $('.close-ss', displayDiv).click(function (e) {
                e.preventDefault();
                if (isFullscreen) {
                    exitFullscreen();
                }
                $(".slideshowpopup", displayDiv).hide();
                if ((typeof plugin.mainSlider != 'undefined') && (plugin.mainSlider.slider != null)) {
                    plugin.mainSlider.destroy(true);
                }
                if (typeof plugin.relatedSlider != 'undefined') {
                    plugin.relatedSlider.destroy(true);
                }
                window.location.replace(('' + window.location).split('#')[0] + '#');
                $('html, body').css('overflowY', 'auto');
                hasSSChanged = true;
                plugin.utils.GAtrackEvent(plugin.ssInfo.title, 'Close');
            });
            // Interstitial close button
            $(".close_interstitial", displayDiv).click(function (e) {
                e.preventDefault();
                isCloseInterstitial = true;
                $(".fullpage_interstitial", displayDiv).empty();
                $(".interstitial_container", displayDiv).fadeOut();

            });
            plugin.mainSlider.ev.on('rsBeforeAnimStart', function (event) {
                $("p.nav_id").text((plugin.mainSlider.currSlideId + 1) + " " + slidePagingIndicator + " " + (plugin.mainSlider.numSlides));
            });
            plugin.mainSlider.ev.on('rsAfterSlideChange', function (event) {
                renderSlideInfo(plugin.slideInfo, plugin.mainSlider.currSlideId);
                afterSlideChange(dartName, contractId, slideshowId);
            });

            // Initialize ads
            plugin.utils.displayAds(dartName, contractId);

            updateAddThis();
            $(window).off('hashchange', updateAddThis);
            $(window).on('hashchange', updateAddThis);

//            var tmp = "<span class=\"rsTmb with-icon\"><i class=\"icon-plus-sign\"></i></span>";
//            $(".gallery div.rsThumbsContainer div.rsThumb:last-child", displayDiv).html(tmp);

            // JIRA : CTSSE-412 - adjust margin top to deal with variation of font-size
            var plus = $(".gallery div.rsThumbsContainer div.rsThumb:last-child .icon-plus-sign", displayDiv);
            var height = plus.height();
            var top = Math.ceil((60 -height) / 2);
            plus.parent().css("margin-top", top);
            // JIRA : CTSSE-412

            $('html, body').css('overflowY', 'hidden');

            if (isFullscreen) {
                keepFullscreen();
            }
