var jQueryCTSS = jQuery;
var TCSlideShow = function (displayUUID, ssInfo, slideInfo, controlsMap) {
    var slideshowRoot = jQueryCTSS("[data-display-uuid = " + displayUUID + "].slideshow_root");
    var displayDiv = slideshowRoot.parents('.slideshowpopup').parent();
    var plugin = displayDiv.data('TCSlideShow');
    var buildPreview = false;
    if (typeof plugin == 'undefined') {
        jQueryCTSS(displayDiv).TCSlideShow();
        plugin = displayDiv.data('TCSlideShow');
        displayDiv.attr('data-slideshow-uuid', controlsMap.slideshowId);
        displayDiv.attr('data-slideshow-url', controlsMap.slideshowUrl);
        buildPreview = true;
    }

    if (typeof ssInfo != 'undefined') {
        plugin.ssInfo = ssInfo;
    }
    if (typeof slideInfo != 'undefined') {
        plugin.slideInfo = slideInfo;
    }
    if (typeof controlsMap != 'undefined') {
        plugin.controlsMap = controlsMap;
    }

    if(buildPreview) {
        plugin.buildPreview();
    }

    return plugin;
}

